import React from 'react';

function PDFViewer(props){
  let currentCard = props.currentCard;
  return (
    <div className="PDFLoading">
      <p>{currentCard.name}</p>
      <p>{currentCard.japaneseName}</p>
      <p>{currentCard.age}</p>
      <p>{currentCard.job}</p>
      <img class="PDFViewer_image" src={currentCard.image} />
    </div>
  )
}

export default PDFViewer;
